import { Carousel, Col, Row, ListGroup } from 'react-bootstrap'

const images = [
    { img: 'carousel_img1.jpg' },
    { img: 'carousel_img2.jpg' },
    { img: 'carousel_img3.jpg' },
    { img: 'carousel_img4.jpg' },
]

function OnlyCarousel(props) {
    const [index, setIndex] = React.useState(0);

    const handleSelect = (selectedIndex, e) => {
        setIndex(selectedIndex);
    };

    return (
        <Carousel activeIndex={index} onSelect={handleSelect} indicators={false} interval='1500'>
            {images && images.map((element, i) =>
                <Carousel.Item key={i}>
                    <img
                        style={{ maxHeight: '40vh', minHeight: '40vh' }}
                        className="d-block w-100"
                        src={element.img}
                        alt='Slide {i}'
                    />
                    <Carousel.Caption>
                        <h3>Slide {index + 1} label</h3>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </Carousel.Caption>
                </Carousel.Item>
            )}
        </Carousel>
    );
}

const CarouselDiv = (props) => {

    return (
        <>
            <Row className='w-100 p-2 m-0 justify-content-center' style={{ background: 'green' }} noGutters >
                <Col lg={3} md={3} sm={0} xs={0} className='d-flex flex-column'>
                    <div className='mb-auto'>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                    <div>Mens Fashion</div>
                </Col>
                <Col lg={9} md={9} sm={12} xs={12}>
                    <OnlyCarousel style={{ maxHeight: '30vh' }} />
                </Col>
            </Row>
        </>
    )
}

export default CarouselDiv
